import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { Button, ButtonToolbar, Alert } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <ButtonToolbar>
        <Button
          variant="primary"
          onProgress={() => {
            const [show, setShow] = useState(true);

            if (show) {
              return (
                <Alert
                  variant="danger"
                  onClose={() => setShow(false)}
                  dismissible
                >
                  <Alert.Heading>Oh snap! You got an error!</Alert.Heading>
                  <p>
                    Change this and that and try again. Duis mollis, est non
                    commodo luctus, nisi erat porttitor ligula, eget lacinia
                    odio sem nec elit. Cras mattis consectetur purus sit amet
                    fermentum.
                  </p>
                </Alert>
              );
            }
            return <Button onClick={() => setShow(true)}>Show Alert</Button>;
          }}
        >
          Primary
        </Button>
      </ButtonToolbar>
    </div>
  );
}

export default App;
